import './Room.css'

const RoomsVideo = (props) => {
    return (
        <div className="room">
            <span className="room-name">{props.room}</span>
            <div className="room-video"></div>
            <span className="room-watchers">{props.watchers} </span>
        </div>
    )
};

export default RoomsVideo;
